import React from 'react';
import { Link as ScrollLink, animateScroll as scroll } from 'react-scroll';
import './AppBar.css'; // Make sure to create a Navbar.css file for styling
import appLogo from './img/logo.png'; // Update with the correct path to your image

const Navbar = () => {
  const scrollToContact = () => {
    scroll.scrollTo('contact-section', {
      smooth: true,
      duration: 500,
    });
  };

  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src={appLogo} alt="logo" className="navbar-logo" />
      </div>
      <div className="navbar-links">
        <ScrollLink to="home" smooth={true} duration={500} offset={-50} className="nav-link">
          Home
        </ScrollLink>
        <ScrollLink to="events" smooth={true} duration={500} offset={-50} className="nav-link">
          Events
        </ScrollLink>
        <ScrollLink to="profile" smooth={true} duration={500} offset={-50} className="nav-link">
          Profile
        </ScrollLink>
        <ScrollLink
          to="contact-section"
          smooth={true}
          duration={500}
          offset={-50}
          className="nav-link"
          onClick={scrollToContact}
        >
          CONTACT US
        </ScrollLink>
      </div>
    </nav>
  );
};

export default Navbar;
